import React from 'react';
import './Projects.css'; // Assurez-vous de créer ce fichier CSS pour le style
import { text } from 'stream/consumers';

// Définissez vos projets sous forme de tableau d'objets
const projects = [
  {
    id: 1,
    title: 'Email Client Prototype',
    subtitle: 'Very first project, ',
    text: 'This is a project I made in my first semester of college. It is a prototype of an email client. It is made with Java and JavaFX. It is a simple email client that can send and receive emails. It is not connected to any email server, it is just a prototype.',
    image: 'project1.png',
    link: '/projet1' // Lien vers les détails du projet
  },
  {
    id: 2,
    title: 'Terminal Enigma Machine',
    subtitle: 'Description du Projet 2',
    image: 'project2.png',
    link: '/projet2'
  },
  {
    id: 3,
    title: 'Resume Website',
    subtitle: 'Description du Projet 2',
    image: 'project3.png',
    link: '/projet2'
  },
  {
    id: 4,
    title: 'Projet 4',
    subtitle: 'Description du Projet 2',
    image: 'logo512.png',
    link: '/projet2'
  },
  {
    id: 5,
    title: 'Projet 5',
    subtitle: 'Description du Projet 2',
    image: 'logo512.png',
    link: '/projet2'
  },
  {
    id: 6,
    title: 'Projet 6',
    subtitle: 'Description du Projet 2',
    image: 'logo512.png',
    link: '/projet2'
  },
  {
    id: 7,
    title: 'Projet 7',
    subtitle: 'Description du Projet 2',
    image: 'logo512.png',
    link: '/projet2'
  }
  // Ajoutez autant de projets que nécessaire
];

function Projects() {
  return (
    <div className="projects-container">
      {projects.map(project => (
        <div key={project.id} className="project-thumbnail">
          <div className="thumbnail-image">
            <img src={project.image} alt={project.title} />
          </div>
          <div className="project-details">
            <h1>{project.title}</h1>
            <p>{project.subtitle}</p>
            <p>{project.text}</p>
            <a href={project.link} className="project-link">GitHub</a>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Projects;
